import React from 'react';
import '../style.css'; // Import CSS file for Navbar component

const Footer = () => {
    return (
        <nav className="footNavbar">
            <h4 className = "unt-logo-f">University of North Texas</h4>
            <nav className = "copyrightFooter"> 
                <p>@{new Date.getFullYear}</p>
            </nav>
        </nav>
    )
}
export default Footer;
